import { StyleSheet } from "react-native";

const geostyles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: '#fff',
        alignItems: 'center',
        justifyContent: 'center',
    },
    title: {
        fontSize: 25,
        color: "blue",
        fontWeight: "bold",
        textAlign: "center"
    },
    input: {
        width: "auto",
        height: 40,
        margin: 10,
        borderColor: "gray",
        borderWidth: 1,
        borderRadius: 10
    },
})
export {geostyles}
